import React from 'react';

function Education() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <img src='media\education.svg' />
                </div>
                <div className='col'>
                    <h1>Free and open market education </h1>

                <p></p>
                </div>
            </div>
        </div>
     );
}

export default Education;
